import { Box, Button, Fab, Grid, TextField, Typography } from '@mui/material'
import React from 'react'

import CloseOutlinedIcon from '@mui/icons-material/CloseOutlined';
import { height, padding } from '@mui/system';
const Add_item = () => {
  return (
    <div>


      {/* WHOLE CONTAINER LOADS */}
      <Grid container spacing={2} style={{
        border:'2px solid red'
      }}>


        {/* Add Item */}
        <Grid container item xs={12} md={12}>
          <Typography variant='h3' marginY={2} marginLeft={2}> Add new item</Typography>
        </Grid>
        

      <br/>

        {/* container inputs */}
        <Grid
  container
  direction="row"
  justifyContent="center"
  alignItems="center"
>

{/* isa pang container para maayos ang margin */}
          <Grid
          container

          marginY={2}
          marginLeft={5}
          marginRight={2}
          direction="row"
          justifyContent="center"
          alignItems="center"
          style={
            {
              border: '2px solid black'
            }
          }
          >
      
            <Grid  >
              <TextField fullWidth  label="Product name" variant="outlined" margin="normal"/>
           
              <TextField fullWidth label="Product name" variant="outlined" margin="normal" />
          
              <TextField fullWidth label="Product name" variant="outlined"  margin="normal" />
          
              <TextField fullWidth label="Product name" variant="outlined"  margin="normal"/>
            </Grid>
            
     

          </Grid>

          <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            marginRight: '16px',
            padding:10
          }}> create </Button>

            <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> cancel </Button>

        </Grid>

        













      </Grid>
      
    </div>
  )
}

export default Add_item
